DROP TABLE IF exists dwd.fact_fae_case_dtl;
CREATE TABLE dwd.fact_fae_case_dtl(
    case_dt date,
    ques_cat varchar(200),
    case_type varchar(30),
    cust_proj_cd varchar(32),
    cust_cd varchar(32),
    emp_cd varchar(258),
    work_hour numeric(24,4),
    prod_cd varchar(32),
    case_stat varchar(30),
    case_stg varchar(30),
    close_dt date,
    expc_close_dt date,
    labor_val numeric(24,4)
);

COMMENT ON TABLE dwd.fact_fae_case_dtl IS 'FAE派单明细';
COMMENT ON COLUMN dwd.fact_fae_case_dtl.case_dt IS '派单日期';
COMMENT ON COLUMN dwd.fact_fae_case_dtl.ques_cat IS '问题分类';
COMMENT ON COLUMN dwd.fact_fae_case_dtl.case_type IS '派单类型';
COMMENT ON COLUMN dwd.fact_fae_case_dtl.cust_proj_cd IS '客户项目编号';
COMMENT ON COLUMN dwd.fact_fae_case_dtl.cust_cd IS '客户编号';
COMMENT ON COLUMN dwd.fact_fae_case_dtl.emp_cd IS '派单员工工号';
COMMENT ON COLUMN dwd.fact_fae_case_dtl.work_hour IS '工时';
COMMENT ON COLUMN dwd.fact_fae_case_dtl.prod_cd IS '产品编号';
COMMENT ON COLUMN dwd.fact_fae_case_dtl.case_stat IS '派单状态';
COMMENT ON COLUMN dwd.fact_fae_case_dtl.case_stg IS '派单阶段';
COMMENT ON COLUMN dwd.fact_fae_case_dtl.close_dt IS '关单日期';
COMMENT ON COLUMN dwd.fact_fae_case_dtl.expc_close_dt IS '期望关单日期';
COMMENT ON COLUMN dwd.fact_fae_case_dtl.labor_val IS '人力';
